import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";
import { useNavigate, redirect, Form } from "react-router-dom";
import Divider from "@mui/material/Divider";

export default function Appartamenti() {
  const navigate = useNavigate();
  return (
    <Container
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        width: "100vw",
      }}
    >
      <Container
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "95vh",
          width: "100vw",
          backgroundColor: "rgb(203, 231, 253)",
          borderRadius: "5vh",
        }}
      >
        <Grid
          container
          spacing={1}
          justifyContent="center"
          alignItems="center"
          sx={{ flexGrow: 1 }}
        >
          <Grid
            container
            direction="column"
            sx={{ flexGrow: 1 }}
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              height: "90vh",
              width: "35vw",
            }}
          >
            <Grid
              style={{
                height: "10%",
              }}
            >
              <Typography
                variant="h4"
                color="rgb(0, 76, 134)"
                sx={{ fontWeight: "bold" }}
              >
                I miei Appartamenti
              </Typography>
            </Grid>
            <Grid
              style={{
                height: "90%",
                backgroundColor: "rgb(44, 135, 50)",
              }}
            >
              <Typography>I miei Appartamenti</Typography>
            </Grid>
          </Grid>
          <Divider orientation="vertical" flexItem />
          <Grid
            container
            direction="column"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              height: "90vh",
              width: "35vw",
            }}
          >
            <Grid
              style={{
                height: "10%",
              }}
            >
              <Typography
                variant="h4"
                color="rgb(0, 76, 134)"
                sx={{ fontWeight: "bold" }}
              >
                Nuovo Appartamento
              </Typography>
            </Grid>
            <Grid
              style={{
                height: "90%",
                backgroundColor: "rgb(44, 135, 50)",
              }}
            >
              <Divider flexItem />
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </Container>
  );
}
